import React, {useEffect, useState} from "react";
import { useNavigate, Link, Routes, Router} from "react-router-dom";

const userData = JSON.parse(localStorage.getItem("userData"))
function JournalList(){
    const history = useNavigate();
    if(!localStorage.getItem("loginStatus") === "true"){
        history("/");
        return null;

    }
    else{
        useEffect(()=>{
            fetch("https://fathomless-garden-99838.herokuapp.com/addresses")
        .then(response => response.json())
        .then(addresses => setAddressData(addresses));
        })

        return(
            <div>
                <h2>WELCOME {userData.username.toUpperCase()}</h2>
                <div id= "logoutContainer">
                    <Link id={"logout"} to={'/'} onclick={()=>{
                        localStorage.clear()
                        history("/")
                    }}>logout</Link>
                </div>

            </div>
        )
    }
}

export default JournalList
